  false,\n\t\"url\": null,\n\t\"notes\": \"<p>Changes in the rates of TBI-related
  deaths vary depending on age.  For persons 44 years of age and younger, TBI-related
  deaths decreased between the periods of 2001u20132002 and 2009u20132010.  Rates
  for age groups 45u201364 years of age remained stable for this same ten-year period.
  \ For persons 65 years and older, rates of TBI-related deaths increased during this
  time period, from 41.2 to 45.2 deaths per 100,000.</p>n<p>Go to <a href=\"http://www.cdc.gov/traumaticbraininjury/data/index.html\">http://www.cdc.gov/traumaticbraininjury/data/index.html</a>
  to view more TBI data &amp; statistics.</p>n<p>Source: <a href=\"http://www.cdc.gov/traumaticbraininjury/data/rates_deaths_byage.html\">http://www.cdc.gov/traumaticbraininjury/data/rates_deaths_byage.html</a></p>n\",\n\t\"license_title\":
